use workforce4;
CREATE TABLE impact_signals (
    impact_id INT AUTO_INCREMENT PRIMARY KEY,
    employee_id INT NOT NULL,

    bugs_fixed INT DEFAULT 0,
    critical_bugs_fixed INT DEFAULT 0,
    features_delivered INT DEFAULT 0,
    incidents_prevented INT DEFAULT 0,
    performance_improvements INT DEFAULT 0,
    refactors_completed INT DEFAULT 0,
    mentoring_sessions INT DEFAULT 0,
    reviews_accepted INT DEFAULT 0,

    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,

    CONSTRAINT fk_impact_employee
        FOREIGN KEY (employee_id)
        REFERENCES employees(employee_id)
        ON DELETE CASCADE
);

